        // Create the target
        org.w3c.dom.Document IFTMIN_D99B2Doc = (IFTMIN_D99B2Target.getType() == world.dovetail.edifactcommon.io.Output.IO_DOM) ? IFTMIN_D99B2Target.getDocument() : XmlTreeOperations.createDocument();

